import React, { Component } from "react";
import Link from "next/link";
import Layout from "../../../src/components/projectPages/projectLayout";
import BackgroundWriteup from "../../../src/components/projectPages/background";

class App extends Component {
  state = {};
  render() {
    return (
      <Layout projectImgPath="soloStander">
        <div className="container ">
          <BackgroundWriteup>
            <p className="text-xl text-gray-600 mx-auto mb-6 w-2/3">
              There are 265,000 people with a spinal chord injury in the United
              States alone. When faced with this difficult challenge, almost
              everyone feels as they have lost a key part of their independence.
            </p>
            <p className="text-xl text-gray-600 mx-auto mb-6 w-2/3">
              One part of this multifaceted challenge is the losing ability to
              stand and the social, practical, and health issues that come with
              it.
            </p>
            <p className="text-xl text-gray-600 mx-auto mb-6 w-2/3">
              In the spring of 2019, I led a team of engineers through the
              design and development of a commercialization plan, commissioned
              by a med-tech startup company, in the design of a standing device
              for people with paraplegia.
            </p>
          </BackgroundWriteup>
        </div>
      </Layout>
    );
  }
}

export default App;
